CREATE TABLE IF NOT EXISTS dosen (
    id INT AUTO_INCREMENT PRIMARY KEY,
    nama_dosen VARCHAR(200) NOT NULL,
    nip VARCHAR(30) NULL,
    nidn VARCHAR(30) NULL,
    kode_fakultas CHAR(2) NULL,
    program_studi_1 VARCHAR(200) NULL,
    program_studi_2 VARCHAR(200) NULL,
    program_studi_3 VARCHAR(200) NULL,
    program_studi_4 VARCHAR(200) NULL,
    bidang_keilmuan_1 VARCHAR(200) NULL,
    bidang_keilmuan_2 VARCHAR(200) NULL,
    bidang_keilmuan_3 VARCHAR(200) NULL,
    bidang_keilmuan_4 VARCHAR(200) NULL,
    email VARCHAR(150) NULL,
    alamat_kantor TEXT NULL,
    link_dosen VARCHAR(255) NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    CONSTRAINT fk_dosen_fakultas
      FOREIGN KEY (kode_fakultas) REFERENCES fakultas(kode_fakultas)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

